void wait_for_vsync() {
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    *pixel_ctrl_ptr = 1; // Start the synchronization process

    // Wait for the S bit to become 0 again
    while (*(pixel_ctrl_ptr + 3) & 0x1);
}

void initialize_coordinates() {
    // dish coordinates
    pizza_coordinates[0].x = 13;    // starting x position of first dish to be made
    pizza_coordinates[0].y = 14;    // starting y position of first dish to be made
    pizza_coordinates[1].x = 64;    // starting x position of second dish to be made
    pizza_coordinates[1].y = 4;     // starting y position of second dish to be made
    pizza_coordinates[2].x = 105;   // starting x position of third dish to be made
    pizza_coordinates[2].y = 4;     // starting y position of third dish to be made
    pizza_coordinates[3].x = 147;   // starting x position of fourth dish to be made
    pizza_coordinates[3].y = 4;     // starting y position of fourth dish to be made

    // chef coordinates
    chef_coordinates.x = 120;
    chef_coordinates.y = 72;
}

void initialize_pizza(struct pizza * pizza, int type) {
    if(type < 0 || type > 7) return; // invalid type, should be between 0 and 7
    
    pizza->type = type;
    pizza->complete = false;

    pizza->veg = (bool) ((type & 0x1) == 0x1);
    pizza->pepperoni = (bool) ((type & 0x2) == 0x2);
    pizza->bacon = (bool) ((type & 0x4) == 0x4);
    
    return;
}

void initialize_timer(int frequency, int t) {
    timer->control = 0x8; // stop timer
    timer->period_low = (frequency & 0xFFFF); // lower half of the clock frequency bits
    timer->period_high = (frequency >> 16 & 0xFFFF); // higher half of the clock frequency bits
    timer->control = 0x6; // start timer & make continuous
    time = t;
}

int get_time() {
    if((timer->status & 0x1) == 0x1){ // if a timeout was reached
        timer->status = 0x0; // reset flag
        time--;
    }

    if(time == 0) timer->control = 0x8; // stop timer if out of time
    return time;
}

void play_sound(int frequency, int length){
    int sample_period = SAMPLE_RATE / frequency;
    for (int i = 0; i < length * sample_period; i++) {
        if ((audio_p->wsrc != 0) && (audio_p->wslc != 0)) {
        // output HIGH for first half of period and low for second half of period
            audio_p->ldata = ((i % sample_period) < sample_period / 2) ? 0x0FFFFFFF : 0;
            audio_p->rdata = ((i % sample_period) < sample_period / 2) ? 0x0FFFFFFF : 0;
        }
    }
}

void display_hex(int num){
    int digit_0 = 0;
    int digit_1 = 0;
    int digit_2 = 0;
    int digit_3 = 0;

    digit_0 = hex_decode(num % 10); // digit 0

    num = num / 10;
    if(num != 0) digit_1 = hex_decode(num % 10); // digit 1, only if the rest are not 0

    num = num / 10;
    if(num != 0) digit_2 = hex_decode(num % 10); // digit 2, only if the rest are not 0

    num = num / 10;
    if(num != 0) digit_3 = hex_decode(num % 10); // digit 3, only if the rest are not 0

    *HEXs = (digit_0 | (digit_1 << 8) | (digit_2 << 16) | (digit_3 << 24)); // combine with bitwise OR
}

int hex_decode(int num){
    int decoded = 0;
    switch (num) {
        case 0: decoded = HEX_0;
        break;
        case 1: decoded = HEX_1;
        break;
        case 2: decoded = HEX_2;
        break;
        case 3: decoded = HEX_3;
        break;
        case 4: decoded = HEX_4;
        break;
        case 5: decoded = HEX_5;
        break;
        case 6: decoded = HEX_6;
        break;
        case 7: decoded = HEX_7;
        break;
        case 8: decoded = HEX_8;
        break;
        case 9: decoded = HEX_9;
        break;
        default: decoded = 0;
    }
    return decoded;
}

